css:
.editor {
  background-color: #ffffff;
  color: #000000;
}
.editor .gutter {
  background-color: #ffffff;
  color: #000000;
}
.editor .gutter .line-number.cursor-line {
  background-color: rgba(165, 165, 165, 0.15);
  color: #000000;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #000000;
}
.editor .wrap-guide {
  color: #e0e0e0;
}
.editor .indent-guide {
  color: #e0e0e0;
}
.editor .invisible-character {
  color: #e0e0e0;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: #e0e0e0;
}
.editor .search-results .marker.current-result .region {
  border: #000000;
}
.editor.is-focused .cursor {
  border-color: #000000;
}
.editor.is-focused .selection .region {
  background-color: #c2e8ff;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: rgba(165, 165, 165, 0.15);
}
.comment {
  color: #9F9F8F;
}
.string {
  color: #F25A00;
}
.constant.numeric {
  color: #AE81FF;
}
.constant.language {
  color: #AE81FF;
}
.constant.character,
.constant.other {
  color: #AE81FF;
}
.keyword {
  color: #F92672;
}
.storage {
  color: #F92672;
}
.storage.type {
  font-style: italic;
  color: #28C6E4;
}
.entity.name.class {
  text-decoration: underline;
  color: #6AAF19;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #6AAF19;
}
.entity.name.function {
  color: #6AAF19;
}
.variable.parameter {
  font-style: italic;
  color: #FD971F;
}
.entity.name.tag {
  color: #F92672;
}
.entity.other.attribute-name {
  color: #6AAF19;
}
.support.function {
  color: #28C6E4;
}
.support.constant {
  color: #28C6E4;
}
.support.type,
.support.class {
  font-style: italic;
  color: #28C6E4;
}
.invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
.invalid.deprecated {
  color: #F8F8F0;
  background-color: #AE81FF;
}
